import React from "react";
import Card from "./Card";
import Avatar from "./Avatar";
import contacts from "../contacts";

function createCard(contact) {
  return (
    <Card
  key={contact.id}
  name={contact.name}
  img={contact.imgUrl}
  phone={contact.phone}
  email={contact.email}
  />
  );
}
function App() {
